import stadium from "../../images/stadium.jpg";
import "./home.css";
import AliceCarousel from "react-alice-carousel";
import "react-alice-carousel/lib/alice-carousel.css";
import balls from "../../images/balls.jpg";
import yellowBoots from "../../images/yellowBoots.jpg";
import jersey from "../../images/jersey.png";

const Home = () => {
   return (
      <div className="Home">
         <div className="titleContainer">
            {/* <h2 className="pageTitle">About Us</h2> */}
            {/* <img src={stadium} className="homeImage" /> */}
            <AliceCarousel
               autoPlay
               autoPlayInterval={3000}
               animationType="fadeout"
               infinite="true"
            >
               <p>
                  <img src={balls} alt="balls" className="sliderimg1" />
               </p>
               <p>
                  <img
                     src={yellowBoots}
                     alt="yellowBoots"
                     className="sliderimg2"
                  />
               </p>
               <p>
                  <img src={jersey} alt="jersey" className="sliderimg3" />
               </p>
            </AliceCarousel>
         </div>
         <header className="homeHeader">Home</header>
      </div>
   );
};

export default Home;
